", "class Solution:

	def fact(self, dp, p):
		dp[0] = 1
		for i in range(1, p):
			dp[i] = dp[i - 1] * i % p

	def inverse(self, x, p):
		if not x:
			return 1
		for i in range(1, p):
			if int(x * i % p) == int(1 % p):
				return i

	def find(self, n, r, p, dp):
		if n < r:
			return 0
		num = dp[n]
		den = dp[n - r] * dp[r] % p
		val = num * self.inverse(den, p) % p
		return val

	def lucas(self, n, r, dp, p):
		if r == 0:
			return 1
		ni = int(n % p)
		ri = int(r % p)
		return self.lucas(n / p, r / p, dp, p) * self.find(ni, ri, p, dp) % p

	def nCr(self, n, r):
		p = 1000003
		dp = [0] * 1000004
		self.fact(dp, p)
		return self.lucas(n, r, dp, p)
