["import heapq

def find(V, N, S):
	dist = [-1 for x in range(N)]
	visited = [False for x in range(N)]
	Q = [(0, S)]
	dist[S] = 0
	while Q:
		(mindist, minv) = heapq.heappop(Q)
		if not visited[minv]:
			for x in V[minv]:
				if dist[x] == -1:
					dist[x] = mindist + V[minv][x]
				else:
					dist[x] = min(dist[x], mindist + V[minv][x])
				heapq.heappush(Q, (dist[x], x))
			visited[minv] = True
	del dist[S]
	for x in dist:
		print(x, end=' ')
	print()

