import unittest
Edge = collections.namedtuple('Edge', ['cost', 'start', 'destination'])

class Graph(object):

	def __init__(self):
		self.nodes = set()
		self.edges = collections.defaultdict(list)

	def add_node(self, node):
		self.nodes.add(node)

	def add_edge(self, vertex1, vertex2, cost):
		self.nodes.add(vertex1)
		self.nodes.add(vertex2)
		self.edges[vertex1].append(Edge(cost=cost, start=vertex1, destination=vertex2))
		self.edges[vertex2].append(Edge(cost=cost, start=vertex2, destination=vertex1))

	@staticmethod
	def from_edges(edges):
		graph = Graph()
		for (start, end, cost) in edges:
			graph.add_edge(start, end, cost)
		return graph
VertexPriority = collections.namedtuple('VertexPriority', ['cost', 'vertex'])

def find_shortest_path(graph, start):
	travel_costs = {node: float('+inf') for node in graph.nodes}
	travel_costs[start] = 0
	nodes_visited = set()
	frontier = queue.PriorityQueue()
	frontier.put(VertexPriority(cost=0, vertex=start))
	while not frontier.empty():
		(_cost, node_current) = frontier.get()
		node_cost = travel_costs[node_current]
		if node_current in nodes_visited:
			continue
		else:
			nodes_visited.add(node_current)
		for edge in graph.edges[node_current]:
			if edge.destination in nodes_visited:
				continue
			destination_cost = min(node_cost + edge.cost, travel_costs[edge.destination])
			frontier.put(VertexPriority(cost=destination_cost, vertex=edge.destination))
			travel_costs[edge.destination] = destination_cost
	for (node, cost) in travel_costs.items():
		if cost == float('+inf'):
			travel_costs[node] = -1
	return travel_costs

