			if self.ctr[next_char] < DequeCounter.st_num:
				self.ctr[next_char] += 1
				self.right.append(self.right_potential.popleft())
			else:
				break
		self.max_len = self.tot_length()

	def consume_all_possible_left(self):
		while self.left_potential:
			next_char = self.left_potential[-1]
			if self.ctr[next_char] < DequeCounter.st_num:
				self.ctr[next_char] += 1
				self.left.appendleft(self.left_potential.pop())
				self.max_len = max(self.tot_length(), self.max_len)
			else:
				break

	def give_up_right_till(self):
		while self.right and self.left_potential:
			rc = self.right.pop()
			self.ctr[rc] -= 1
			if rc == self.left_potential[-1] or not self.right:
				self.consume_all_possible_left()
