class Solver:

	def __init__(self, inputValue):
		self.inputValue = inputValue
		self.strlen = len(inputValue)

	def solve(self):
		if not self.computeSurplus():
			return 0
		queue = collections.deque()
		candidates = self.getCandidates()
		result = 999999
		while True:
			while not self.validator.isMatchingSurplus():
				candidate = next(candidates, None)
				if candidate is None:
					return result
				queue.append(candidate)
				self.validator.add(candidate[1])
			while self.validator.isMatchingSurplus():
				result = min(result, queue[-1][0] - queue[0][0] + 1)
				if result <= 1:
					return result
				self.validator.subtract(queue.popleft()[1])
		return result

	def computeSurplus(self):
		self.validator = Validator(self.strlen // 4)
		for c in self.inputValue:
			self.validator.add(c)
		if self.validator.isSteady():
			return False
		self.validator.switchToSurplusMode()
		return True

	def getCandidates(self):

		def gen():
			for (index, value) in enumerate(self.inputValue):
				if self.validator.belongsToSurplus(value):
					yield (index, value)
		return gen()

class Validator:

	def __init__(self, bucketSize):
		self.bucketSize = bucketSize
		self.buckets = [0, 0, 0, 0]

	def add(self, obj):
		index = ord(obj) * 3 % 5
		self.buckets[index] += 1

	def subtract(self, obj):
		index = ord(obj) * 3 % 5
		self.buckets[index] -= 1

	def switchToSurplusMode(self):
		self.surplus = [0, 0, 0, 0]
		for i in range(len(self.buckets)):
			if self.buckets[i] > self.bucketSize:
				self.surplus[i] = self.buckets[i] - self.bucketSize
		self.buckets = [0, 0, 0, 0]

	def belongsToSurplus(self, obj):
		return self.surplus[ord(obj) * 3 % 5] > 0

	def isMatchingSurplus(self):
		for (index, value) in enumerate(self.surplus):
			if 0 < value > self.buckets[index]:
				return False
		return True

	def isSteady(self):
		for c in self.buckets:
			if c > self.bucketSize:
				return False
		return True
