		letter = dna[x]
		counts[letter].append(x)
	diffs = {}
	stacks = {}
	for key in counts:
		count = counts[key]
		diff = len(count) - balanced_count
		if diff > 0:
			diffs[key] = diff
			stacks[key] = []
	if len(diffs) == 0:
